import { Injectable } from '@angular/core';
import { ExamenPhysique } from '../models/ExamenPhysique';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class ExamphyService {
  private apiUrl = 'https://localhost:7129/api/ExamenPhysiques';

  constructor(private http: HttpClient) { }
  addexam(ExamenPhysique: ExamenPhysique): Observable<any> {
    console.log('Creating it with data:', ExamenPhysique);

    return this.http.post(`${this.apiUrl}/addexam`, ExamenPhysique, { observe: 'response', responseType: 'text' });
  }
  getById(id: number): Observable<ExamenPhysique> {
    return this.http.get<any>(`${this.apiUrl}/${id}`);
  }

  update(id: number, ExamenPhysique: ExamenPhysique): Observable<any> {
    return this.http.put(`${this.apiUrl}/update/${id}`, ExamenPhysique, { observe: 'response' });
}
}
